funcSearch:
  function funcSearch() {
    log("funcSearch");
    const els = document.getElementsByClassName("bt_cancel");
    const result = [];
    const dictCourse = {
      11: "단일",
    };
    Array.from(els).forEach((el) => {
      const param = el.parentNode.getAttribute("href").inparen();
      const date = param[0].split("-").join("");
      const time = param[1];
      const course = param[2];
      console.log("reserve search", dictCourse[course], date, time);
      result.push({ date, time, course: dictCourse[course] });
    });
    const param = {
      golf_club_id: "085e0a52-f129-11ec-a93e-0242ac11000a",
      device_id: "${deviceId}",
      result,
    };
    const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
    post(addr, param, { "Content-Type": "application/json" }, (data) => {
      console.log(data);
      LOGOUT();
    });
  }
